import React from "react";
import InfoCard from "../../components/InfoCard/InfoCard";

const AmilaInfo = ()=>{
    return(
        <div>
            <InfoCard name={"Amila"} surname={"Borancic"}>
                I'm too tired to be bored I'm too bored to be tired (Green Day, nisam ja ovo smisljala)
            </InfoCard>
        </div>
    );
}

export default AmilaInfo;
